import * as React from 'react';
import Grid from '@mui/material/Grid';
import '../ComponentStyle/Participant.css';
import backgroundImage from '../images/person1.png';
//import Item  from '@mui/material/Grid';

//import Item from '@mui/material/Item';

function Userscreen() {
  return (
    <Grid container style={{ height: '100vh' }}>
    <Grid item xs={12} style={{ height: '50%'}}>
        <Grid container className='grid1' style={{  height: '100%' }}>
                <Grid item xs={6} style= {{height: '100vh',
          backgroundImage: `url(${backgroundImage})`,
          backgroundSize: 'cover',
          backgroundRepeat: 'no-repeat',
          backgroundPosition: 'center center'}} > 
                </Grid>
                <Grid item xs={6} style={{ background: 'red'}}>
                    Column 2
                </Grid>
        </Grid>
    </Grid>
    <Grid item xs={12} style={{ height: '50%', background: 'blue' }}>
    <Grid container style={{  height: '100%' }}>
      <Grid item xs={6} style={{ background: 'blue' }}>
        Column 1
      </Grid>
      <Grid item xs={6} style={{ background: 'white'}}>
        Column 2
      </Grid>
    </Grid>
    </Grid>
  </Grid>
  );
}


  export default Userscreen;
